// ==UserScript==
// @name         DownloadTracker
// @namespace    http://tampermonkey.net/
// @version      1.0.0
// @description  Log download info (current URL, download link, redirects) to local storage and uses hotkeys to display, delete, or save the logs.
// @match        *://*/*
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM_deleteValue
// @grant        GM_listValues
// @grant        GM_addValueChangeListener
// @icon         data:image/webp;base64,
// @license      MIT
// ==/UserScript==

(function() {
    'use strict';

    const STORAGE_KEY = 'downloadInfo';
    const downloadExtensions = [
        '.exe', '.msi', '.zip', '.tar.gz', '.tar.bz2', '.tar.xz', '.7z', '.rar', '.deb', '.rpm', '.iso', '.dmg', 
        '.bin', '.sh', '.run', '.img', '.gz', '.xz', '.bz2', '.tgz', '.tbz2', '.txz', '.jar', '.war', 
        '.apk', '.bat', '.cmd', '.vbs', '.ps1', '.py', '.rb', '.pl', '.java', '.c', '.cpp', '.cs', 
        '.html', '.htm', '.css', '.js', '.php', '.xml', '.json', '.svg', '.md', '.txt', '.rtf', 
        '.pdf', '.doc', '.docx', '.xls', '.xlsx', '.ppt', '.pptx', 
        '.mp3', '.wav', '.ogg', '.flac', '.aac', '.wma', '.m4a', '.m4b', 
        '.mp4', '.mkv', '.avi', '.mov', '.wmv', '.flv', '.webm', '.mpeg', '.mpg', '.m2ts', '.mts', '.ts'
    ]; 

    // Function to log the download info
    function logDownloadInfo(currentURL, downloadURL, redirectURLs) {
        let storedData = GM_getValue(STORAGE_KEY, []);

        let logEntry = {
            currentURL: currentURL,
            downloadURL: downloadURL,
            redirectURLs: redirectURLs
        };

        // Remove duplicates
        let isDuplicate = storedData.some(entry =>
            entry.currentURL === logEntry.currentURL &&
            entry.downloadURL === logEntry.downloadURL &&
            entry.redirectURLs.join('') === logEntry.redirectURLs.join('')
        );

        if (!isDuplicate) {
            storedData.push(logEntry);
            GM_setValue(STORAGE_KEY, storedData);
            console.log(`Logged Download Info:\n${currentURL}\n${downloadURL}\n${redirectURLs.join('\n')}`);
        } else {
            console.log('Duplicate entry found, not logging.');
        }
    }

    // Function to check if the URL is a download link
    function isDownloadLink(url) {
        return downloadExtensions.some(ext => url.toLowerCase().endsWith(ext));
    }

    // Function to display the download info
    function displayDownloadInfo() {
        let storedData = GM_getValue(STORAGE_KEY, []);

        if (storedData.length === 0) {
            alert('No download info logged yet.');
            return;
        }

        let logText = storedData.map(entry =>
            `Current URL: ${entry.currentURL}\nDownload URL: ${entry.downloadURL}\nRedirect URLs: ${entry.redirectURLs.join(' ')}`
        ).join('\n\n');

        alert(logText);

        if (confirm('Do you want to save the log to your PC?')) {
            downloadLogFile(logText);
        }
    }

    // Function to download the log file
    function downloadLogFile(content) {
        let blob = new Blob([content], { type: 'text/plain' });
        let url = URL.createObjectURL(blob);
        let a = document.createElement('a');
        a.href = url;
        a.download = 'download_log.txt'; // Default file name
        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
        URL.revokeObjectURL(url);
        console.log(`Log saved to the default location with the file name 'download_log.txt'`);
    }

    // Function to clear the download log
    function clearDownloadLog() {
        let storedData = GM_getValue(STORAGE_KEY, []);
        if (storedData.length === 0) {
            alert('No download info to delete.');
            return;
        }

        if (confirm('Do you want to save the log before deleting?')) {
            let logText = storedData.map(entry =>
                `Current URL: ${entry.currentURL}\nDownload URL: ${entry.downloadURL}\nRedirect URLs: ${entry.redirectURLs.join(' ')}`
            ).join('\n\n');
            downloadLogFile(logText);
        }

        GM_deleteValue(STORAGE_KEY);
        console.log('Download log cleared.');
        alert('Download log has been cleared.');
    }

    // Function to handle download link click
    function handleDownloadClick(event) {
        let target = event.target;

        // Check if the target is a download link
        if (target.tagName === 'A' && target.href && isDownloadLink(target.href)) {
            console.log(`Download link clicked: ${target.href}`);

            let currentURL = window.location.href;
            let downloadURL = target.href;
            let redirectURLs = [];

            // Use fetch to capture the redirects and headers
            fetch(downloadURL, { method: 'HEAD' }).then(response => {
                if (response.redirected) {
                    redirectURLs.push(response.url);
                }
                response.headers.forEach((value, key) => {
                    if (key.toLowerCase() === 'location') {
                        redirectURLs.push(value);
                    }
                });

                // Check if Content-Disposition header indicates a file download
                if (response.headers.get('Content-Disposition') && response.headers.get('Content-Disposition').toLowerCase().includes('attachment')) {
                    logDownloadInfo(currentURL, downloadURL, redirectURLs);
                } else {
                    console.log('Not a download link based on Content-Disposition header.');
                }
            }).catch(error => {
                console.error('Error fetching the download URL:', error);
                logDownloadInfo(currentURL, downloadURL, redirectURLs);
            });
        }
    }

    // Add event listeners for download links
    document.addEventListener('click', handleDownloadClick, true);

    // Use MutationObserver to handle dynamically added links
    const observer = new MutationObserver(mutations => {
        mutations.forEach(mutation => {
            if (mutation.addedNodes.length) {
                mutation.addedNodes.forEach(node => {
                    if (node.tagName === 'A' && node.href) {
                        node.addEventListener('click', handleDownloadClick, true);
                    }
                });
            }
        });
    });

    observer.observe(document.body, {
        childList: true,
        subtree: true
    });

    // Add hotkeys
    document.addEventListener('keydown', function(event) {
        if (event.ctrlKey && event.altKey && event.key === '5') {
            console.log('Hotkey pressed: Ctrl + Alt + 5');
            event.preventDefault();
            displayDownloadInfo();
        } else if (event.altKey && event.key === '5') {
            console.log('Hotkey pressed: Alt + 5');
            event.preventDefault();
            clearDownloadLog();
        }
    });

})();
